import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Home from './paginas/pgInicial/pgInicial.js';
import LDDE from './paginas/LDDE';

const Main = () => {
  return (
    <Switch>
      <Route exact path='/' component={Home}></Route>
      <Route exact path='/signup' component={LDDE}></Route>
    </Switch>
  );
}

export default Main;
